[include mainsail.cfg]
[include macros.cfg]
[include timelapse.cfg]
[include lcdmenu.cfg]
#[include PIS.cfg]
[include BDSensor.cfg]
[include KAMP_Settings.cfg]

# [tmc2208 stepper_x] #aktivieren nach tauschen der treiber
# uart_pin:
# #   The pin connected to the TMC2208 PDN_UART line. This parameter
# #   must be provided.
# #tx_pin:
# #   If using separate receive and transmit lines to communicate with
# #   the driver then set uart_pin to the receive pin and tx_pin to the
# #   transmit pin. The default is to use uart_pin for both reading and
# #   writing.
# #select_pins:
# #   A comma separated list of pins to set prior to accessing the
# #   tmc2208 UART. This may be useful for configuring an analog mux for
# #   UART communication. The default is to not configure any pins.
# #interpolate: True
# #   If true, enable step interpolation (the driver will internally
# #   step at a rate of 256 micro-steps). This interpolation does
# #   introduce a small systemic positional deviation - see
# #   TMC_Drivers.md for details. The default is True.
# run_current:
# #   The amount of current (in amps RMS) to configure the driver to use
# #   during stepper movement. This parameter must be provided.
# #hold_current:
# #   The amount of current (in amps RMS) to configure the driver to use
# #   when the stepper is not moving. Setting a hold_current is not
# #   recommended (see TMC_Drivers.md for details). The default is to
# #   not reduce the current.
# #sense_resistor: 0.110
# #   The resistance (in ohms) of the motor sense resistor. The default
# #   is 0.110 ohms.
# #stealthchop_threshold: 0
# #   The velocity (in mm/s) to set the "stealthChop" threshold to. When
# #   set, "stealthChop" mode will be enabled if the stepper motor
# #   velocity is below this value. The default is 0, which disables
# #   "stealthChop" mode.
# #driver_MULTISTEP_FILT: True
# #driver_IHOLDDELAY: 8
# #driver_TPOWERDOWN: 20
# #driver_TBL: 2
# #driver_TOFF: 3
# #driver_HEND: 0
# #driver_HSTRT: 5
# #driver_PWM_AUTOGRAD: True
# #driver_PWM_AUTOSCALE: True
# #driver_PWM_LIM: 12
# #driver_PWM_REG: 8
# #driver_PWM_FREQ: 1
# #driver_PWM_GRAD: 14
# #driver_PWM_OFS: 36
# #   Set the given register during the configuration of the TMC2208
# #   chip. This may be used to set custom motor parameters. The
# #   defaults for each parameter are next to the parameter name in the
# #   above list.

[stepper_x]
step_pin: PA3
dir_pin: !PA1
enable_pin: !PA5
microsteps: 16
rotation_distance: 39,7 #40
endstop_pin: ^!PA0
position_endstop: 0
position_max: 203
homing_speed: 50.0

[stepper_y]
step_pin: PC6
dir_pin: PC4
enable_pin: !PA7
microsteps: 16
rotation_distance: 39,7 #40
endstop_pin: ^!PA4
position_endstop: 0
position_max: 203
homing_speed: 50.0

[stepper_z]
step_pin: PC0
dir_pin: !PG2
enable_pin: !PC2
microsteps: 16
rotation_distance: 6
#endstop_pin: ^!PC7
endstop_pin: probe:z_virtual_endstop
position_min: -5
position_max: 200
homing_speed: 20.0
second_homing_speed: 3
homing_retract_dist: 0
homing_retract_speed: 2

[extruder]
step_pin: PL6
dir_pin: PL4
enable_pin: !PG0
#enable_pin: PL5
microsteps: 16
rotation_distance: 3.3500
nozzle_diameter: 0.400
filament_diameter: 2.850
heater_pin: PE4
sensor_type: AD595
sensor_pin: PK0
control: pid
pid_Kp: 22.2
pid_Ki: 1.08
pid_Kd: 114
min_temp: 0
max_temp: 275
max_extrude_cross_section: 8
max_extrude_only_distance: 600.0

[gcode_macro T0]
gcode:
    #SET_SERVO SERVO=extruder_servo angle=100    # Lift secondary extruder
    #SET_GCODE_OFFSET Z=0 MOVE=1                 # Adjust z-height
    #SET_GCODE_OFFSET X=0                        # Clear X offset
    ACTIVATE_EXTRUDER EXTRUDER=extruder
    #{% set EXTRUDER_TEMP1 = params.EXTRUDER_TEMP1|default(175)|float %} # this gives a user input field in case i want another temp for nozzle
    #M104 S{extruder_temp1} T1
    SET_HEATER_TEMPERATURE HEATER=extruder1 TARGET=175

# Dual extruder support.

[extruder1]
# step_pin: PL2
# dir_pin: PL0
# enable_pin: PL1
step_pin: PL0
dir_pin: PL2
enable_pin: !PL1
microsteps: 16
rotation_distance: 3.3500
nozzle_diameter: 1.00
filament_diameter: 2.850
heater_pin: PE5
sensor_type: AD595
sensor_pin: PK1
control: pid
pid_Kp: 22.2
pid_Ki: 1.08
pid_Kd: 114
min_temp: 0
max_temp: 275
max_extrude_cross_section: 8
max_extrude_only_distance: 600.0

[gcode_macro T1]
gcode:
    #SET_GCODE_OFFSET Z=0.100 MOVE=1             # Adjust z-height
    #SET_SERVO SERVO=extruder_servo angle=100    # Position second extruder
    #SET_GCODE_OFFSET Y=21,6                     # Account for different position
    ACTIVATE_EXTRUDER EXTRUDER=extruder1
    #{% set EXTRUDER_TEMP = params.EXTRUDER_TEMP|default(175)|float %} # this gives a user input field in case i want another temp for nozzle
    #M104 S{extruder_temp} T0
    SET_HEATER_TEMPERATURE HEATER=extruder TARGET=175

