#max_temp: 100

[fan]
pin: PH4
max_power: 1
shutdown_speed: 0.0
kick_start_time: 0.1
off_below: 0.1
hardware_pwm: True

[pause_resume]
recover_velocity: 50

[firmware_retraction]
retract_length: 10
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 30

[input_shaper]
shaper_type_x = ei
shaper_freq_x = 39.8
shaper_type_y = 2hump_ei
shaper_freq_y = 40.4

[skew_correction]

[bed_mesh]
speed: 150
horizontal_move_z: 1
mesh_min: -20, 11
mesh_max: 180, 210
probe_count: 50, 50
mesh_pps: 2,2
algorithm: bicubic
bicubic_tension: 0.2
zero_reference_position: 100,100

[force_move] 
enable_force_move: true

[safe_z_home]
home_xy_position: 100,100
z_hop: 5
z_hop_speed: 15

#[verify_heater extruder]
#hysteresis: 5
#max_error: 120
#heating_gain: 2
#check_gain_time: 30

[mcu]
serial: /dev/serial/by-id/usb-Arduino__www.arduino.cc__0042_A4136373037351303110-if00
restart_method: arduino

[mcu host]
serial: /tmp/klipper_host_mcu

[temperature_sensor raspberry_pi_4B]
sensor_type: temperature_host
min_temp: 10
max_temp: 100 

# [temperature_sensor ultiboard]
# sensor_type: temperature_mcu
# min_temp: 0
# max_temp: 100

[printer]
kinematics: cartesian
max_velocity: 500
max_accel: 10000
max_z_velocity: 25
max_z_accel: 30

[respond]
default_prefix: echo:

[static_digital_output hotend_led]
pins: PB7

[display]
lcd_type: hd44780
#   Set to "hd44780" for hd44780 displays.
rs_pin: PD1
e_pin: PH0
d4_pin: PH1
d5_pin: PD0
d6_pin: PE3
d7_pin: PH3
#   The pins connected to an hd44780 type lcd. These parameters must
#   be provided.
hd44780_protocol_init: True
#   Perform 8-bit/4-bit protocol initialization on an hd44780 display.
#   This is necessary on real hd44780 devices. However, one may need
#   to disable this on some "clone" devices. The default is True.
line_length: 20
#   Set the number of characters per line for an hd44780 type lcd.
#   Possible values are 20 (default) and 16. The number of lines is
#   fixed to 4.
encoder_pins: ^PL7, ^PG1
click_pin: ^!PD2
# encoder_pins: PG1, PL7
# click_pin: PD2 
#kill_pin: ^!PG0

[output_pin beeper] 
pin: PD3
pwm: True
value: 0
shutdown_value: 0
cycle_time: 0.001

[exclude_object]

[gcode_arcs]
resolution: 1.0

# Common EXP1 / EXP2 (display) pins
[board_pins]
aliases:
    # Common EXP1 header found on many "all-in-one" ramps clones
    EXP1_2=PC2, EXP1_4=PH1, EXP1_6=PA3, EXP1_8=PA7, EXP1_10=<5V>,
    EXP1_1=PC0, EXP1_3=PH0, EXP1_5=PA1, EXP1_7=PA5, EXP1_9=<GND>,
    # EXP2 header    
    EXP2_2=PB1, EXP2_4=PB0, EXP2_6=PB2, EXP2_8=PG0, EXP2_10=<RST>,
    EXP2_1=PB3, EXP2_3=PC6, EXP2_5=PC4, EXP2_7=PL0, EXP2_9=<GND>,
    # Pins EXP2_1, EXP2_6, EXP2_2 are also MISO, MOSI, SCK of bus "spi"
    # Note, some boards wire: EXP2_8=<RST>, EXP2_10=PG0

    #from reprapwiki f√ºr 1.57. board https://reprap.org/wiki/Ultimaker%27s_v1.5.7_PCB  
    # EXP1_2=PD2, EXP1_4=PD1, EXP1_6=PD0, EXP1_8=PH3, EXP1_10=<5V>,
    # EXP1_1=PD3, EXP1_3=PH0, EXP1_5=PH1, EXP1_7=PE3, EXP1_9=<GND>,
    # EXP2_2=PB1, EXP2_4=PB0, EXP2_6=PB2, EXP2_8=<3.3V>, EXP2_10=<5V>,
    # EXP2_1=PB3, EXP2_3=PL7, EXP2_5=PG0, EXP2_7=PD7, EXP2_9=<GND>,
    


#     ######################################################################
#     # Plug pin locations
#     ######################################################################
    
#     # Some micro-controller boards and displays use inconsistent labeling
#     # for the EXP1 and EXP2 headers. The following diagram shows the
#     # correct location of pin 1 along with ground and power pins on the
#     # EXP1 and EXP2 plugs:
#     #
#     #          EXP1:                        EXP2:
#     #   +-----------------+          +-----------------+
#     #   |  o  o  o  o  5V |          |  o  o  o  o  o  |
#     #   |  1  o  o  o GND |          |  1  o  o  o GND |
#     #   +------     ------+          +------     ------+
#     #
#     # Some boards may have the cutout in the wrong location. If so, it may
#     # be possible to carefully pry the plastic header off of the pins with
#     # a small screwdriver, then correct the orientation and reapply the
#     # plastic header.

